import React from 'react';
import { useNavigate, Link } from "react-router-dom";
import LogoutButton from './LogoutButton';
import Profile from './Profile';
import UserRouteProtection from './UserRouteProtection';

const HomeUser = () => {
    UserRouteProtection();
    const [isProfileclicked, setProfileclicked] = React.useState(false);
    let navigate = useNavigate();
    return (
        <div>
            <h1>Home User Page</h1>
            <p><button onClick={() => {
                    navigate("/");
                }}>Main Page</button></p>
            <LogoutButton />
            <p></p>
            <p><button onClick={() => {
                    navigate("/UserNews");
                }}>News</button></p>
            <p><button onClick={() => {
                    navigate("/UserSafeLocations");
                }}>Safe Locations</button></p>
            <p><button onClick={() => {
                    navigate("/UserFundraisers");
                }}>Fundraisers</button></p>
            <button onClick={() => {isProfileclicked ? setProfileclicked(false) : setProfileclicked(true)}}>View Account Details</button>
            { isProfileclicked ? <Profile /> : null }
        </div>
    )
}

export default HomeUser;
